import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import React, { useEffect } from "react";
import Intro from "./page/Intro";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Intro />} />
      </Routes>
    </div>
  );
}

export default App;
